import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import logo from './logo.svg';

const Header = (props) => {
	return(
	<Navbar bg="dark" variant="dark" sticky="top">
		<Navbar.Brand><img className="logo" src={logo} alt="News-App-Logo"/></Navbar.Brand>
			<Nav className="mr-auto">
				<Nav.Link className="link" href="#us"><i class="fas fa-flag-usa"></i>&nbsp;US</Nav.Link>
				<Nav.Link className="link" href="#business"><i class="fas fa-briefcase"></i>&nbsp;Business</Nav.Link>
				<Nav.Link className="link" href="#technology">Technology</Nav.Link>
				<Nav.Link className="link" href="#sports">Sports</Nav.Link>
				<Nav.Link className="link" href="#entertainment">Entertainment</Nav.Link>
				<Nav.Link className="link" href="#health">Health</Nav.Link>
				<Nav.Link className="linkEnd" href="#science">Science</Nav.Link>
			</Nav>
	</Navbar>
	)
}

export default Header;
